import React, { Component } from 'react';
import Items from './components/Items';

class App extends Component {
	state = {
		items: [
			{
				id: 1,
				itemName: 'Bread',
				price: '0.50',
				image: 'soon',
				lastBrought: {
					by: 'Person',
					date: '02/02/19'
				}
			},
			{
				id: 2,
				itemName: 'Sugar',
				price: '0.96',
				image: 'soon',
				lastBrought: {
					by: 'Person',
					date: '12/02/19'
				}
			},
			{
				id: 3,
				itemName: 'Milk',
				price: '1.09',
				image: 'soon',
				lastBrought: {
					by: 'Person',
					date: '14/02/19'
				}
			}
		]
	}
	render() {
		return (
			<div className="container mt-4">
				<Items items={this.state.items} />
			</div>
		);
	}
}

export default App;
